package org.snekker.jetpack;import net.minecraft.item.Item;import net.minecraft.registry.Registries;import net.minecraft.registry.Registry;import net.minecraft.registry.RegistryKey;import net.minecraft.registry.RegistryKeys;import net.minecraft.util.Identifier;public class ModItems {    public static Item register(Item item, RegistryKey<Item> registryKey) {        Item registeredItem = Registry.register(Registries.ITEM, registryKey.getValue(), item);        return registeredItem;    }    public static final RegistryKey<Item> JETPACK_KEY =            RegistryKey.of(RegistryKeys.ITEM, Identifier.of(Jetpack.MOD_ID, "jetpack"));    public static final Item JETPACK = register(            new JetpackItem(new Item.Settings().registryKey(JETPACK_KEY)),            JETPACK_KEY    );    public static void initialize() {    }}